const ExpenseDate = () => {
    const month = (props.date).toLocaleString('en-GB', {month: 'long'});
    const day = (props.date).toLocaleString('en-GB', {day: 'numeric'});
    const year = (props.date).toLocaleString('en-GB', {year: 'numeric'});


    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    );
}

export default ExpenseDate;
